// TileComponent.jsx
import './TileComponent.css';
import React from 'react';

const TileComponent = ({ title, content, onClick }) => {
  return (
    <div class="tile" onClick={onClick}>
      <h3>{title}</h3>
      <p>{content}</p>
    </div>
  );
};

export default TileComponent;
